import React, { useState } from 'react';
import './Footer.css';
import { syncSubscribers } from '../path/to/syncMailchimpToMongo'; // Adjust the import path

const Footer = () => {
    const [isModalOpen, setIsModalOpen] = useState(false);

    const toggleModal = () => {
        setIsModalOpen(!isModalOpen);
    };

    const handleSubmit = async (e) => {
        e.preventDefault(); // Prevent default form submission

        const form = e.target;
        const formData = new FormData(form);

        try {
            // Send the form data to Mailchimp
            await fetch(form.action, {
                method: form.method,
                body: formData,
            });

            // Sync with MongoDB after successful subscription
            await syncSubscribers();
            alert("Successfully signed up and database synced!");

            // Optionally close the modal
            toggleModal();
        } catch (error) {
            console.error("Error during signup:", error);
        }
    };

    return (
        <footer className="footer">
            <button onClick={toggleModal} className="signup-button">
                Sign Up for Alerts
            </button>

            {isModalOpen && (
                <div className="modal-overlay" onClick={toggleModal}>
                    <div className="modal-content" onClick={(e) => e.stopPropagation()}>
                        <button className="close-button" onClick={toggleModal}>✖</button>
                        <div id="mc_embed_shell">
                            <link
                                href="//cdn-images.mailchimp.com/embedcode/classic-061523.css"
                                rel="stylesheet"
                                type="text/css"
                            />
                            <div id="mc_embed_signup" style={{ background: "#fff", font: "14px Helvetica,Arial,sans-serif", width: "100%" }}>
                                <form
                                    action="https://hamilton.us17.list-manage.com/subscribe/post?u=5655c218737b1c2830a7677a1&amp;id=568adfc2bd&amp;f_id=0058c3e1f0"
                                    method="post"
                                    id="mc-embedded-subscribe-form"
                                    name="mc-embedded-subscribe-form"
                                    className="validate"
                                    target="_blank"
                                    onSubmit={handleSubmit} // Attach the new handler
                                >
                                    <div id="mc_embed_signup_scroll">
                                        <h2>Sign Up for Alerts</h2>
                                        <div className="indicates-required">
                                            <span className="asterisk">*</span> indicates required
                                        </div>
                                        <div className="mc-field-group">
                                            <label htmlFor="mce-EMAIL">
                                                Email Address <span className="asterisk">*</span>
                                            </label>
                                            <input
                                                type="email"
                                                name="EMAIL"
                                                className="required email"
                                                id="mce-EMAIL"
                                                required
                                            />
                                        </div>
                                        <div id="mce-responses" className="clear foot">
                                            <div className="response" id="mce-error-response" style={{ display: "none" }}></div>
                                            <div className="response" id="mce-success-response" style={{ display: "none" }}></div>
                                        </div>
                                        <div aria-hidden="true" style={{ position: "absolute", left: "-5000px" }}>
                                            <input
                                                type="text"
                                                name="b_5655c218737b1c2830a7677a1_568adfc2bd"
                                                tabIndex="-1"
                                                value=""
                                            />
                                        </div>
                                        <div className="optionalParent">
                                            <div className="clear foot">
                                                <input
                                                    type="submit"
                                                    name="subscribe"
                                                    id="mc-embedded-subscribe"
                                                    className="button"
                                                    value="Subscribe"
                                                />
                                            </div>
                                        </div>
                                    </div>
                                </form>
                            </div>
                        </div>
                    </div>
                </div>
            )}
        </footer>
    );
};

export default Footer;
